import marshal
import base64

def execute_encrypted_code(encrypted_code):
    try:
        # Decode from base64
        decoded_code = base64.b64decode(encrypted_code)

        # Unmarshal the code object
        code_object = marshal.loads(decoded_code)

        # Execute the code
        exec(code_object)

    except Exception as e:
        print(f"Error: {e}")
encrypted_code = ""
execute_encrypted_code(encrypted_code)
